import { BrowserRouter as Router, Switch , Route} from 'react-router-dom';
import './App.css';
import Checkout from './Checkout';
import Header from './Header';
import Home from './Home';

function App() {
  return (

      <Router>
        <div className="App">
        <Header />
          <Switch>
          <Route path="/login">
            <Login />
            </Route>
            <Route path="/checkout">
            <Checkout />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </Router>
  );
}

export default App;
